import React from "react";
import { Link, useMatch, useResolvedPath } from "react-router-dom";

export default function Header() {


    function HandleClickLogin() {
        return(
            <Link to="/login"></Link>

        )

    }

    function HandleClickRegister() {

        <Link to="/register"></Link>

    }

    return (

        <div className="header">

            <div className="header--text">

                <CustomLink to="/home">Home</CustomLink>
                <CustomLink to="/obiective">Obiective turistice</CustomLink>
                <CustomLink to="/tipes">Tipuri de obiective turistice</CustomLink>
                <CustomLink to="/test">Test</CustomLink>

            </div>

            <div className="search">
                <input type="text" className="search__input" placeholder="Cauta locatia"/>
                    <button className="search__button">
                        <svg className="search__icon" aria-hidden="true" viewBox="0 0 24 24">
                            <g>
                                <path d="M21.53 20.47l-3.66-3.66C19.195 15.24 20 13.214 20 11c0-4.97-4.03-9-9-9s-9 4.03-9 9 4.03 9 9 9c2.215 0 4.24-.804 5.808-2.13l3.66 3.66c.147.146.34.22.53.22s.385-.073.53-.22c.295-.293.295-.767.002-1.06zM3.5 11c0-4.135 3.365-7.5 7.5-7.5s7.5 3.365 7.5 7.5-3.365 7.5-7.5 7.5-7.5-3.365-7.5-7.5z"></path>
                            </g>
                        </svg>
                    </button>
            </div>

            <div className="login_register">
                <button className="login" onClick={HandleClickLogin()}>Login</button>
                <button className="register" onClick={HandleClickRegister()}>Register</button>

                <button className="login" onClick={HandleClickLogin}>Login</button>
                <button className="register" onClick={HandleClickRegister}>Register</button>

                

            </div>

        </div>
    )
}

function CustomLink({to, children, ...props}) {

    const resolvePatch = useResolvedPath(to)
    const isActive = useMatch({ path: resolvePatch.pathname, end: true})
    return(
        <Link className={isActive ? "active" : ""}  to={to} {...props}>
            {children}
        </Link>
    )

}
